import React from "react";
import Parse from "parse";
import { useNavigate } from "react-router-dom";

// COMPONENTS
import NavigationBar from "../../components/NavigationBar/NavigationBar";
import PageTitle from "../../components/PageTitle/PageTitle";
import Button from "../../components/Button/Button";
import "./../../App.css";
import "./Settings.css";

export default function Settings() {
  const navigate = useNavigate();

  console.log("current user", Parse.User.current());

  async function handleLogOut() {
    await Parse.User.logOut();
    if (Parse.User.current() === null) {
      alert("You are succesfully logged out");
      navigate("/");
    }
  }

  return (
    <div>
      <header>
        <div>
          <div>
            <PageTitle title="Settings" logo={true} />
          </div>
        </div>
      </header>

      <body>
        <div className="buttons">
          <div className="settings-buttons">
            <Button text="Hide profile" style="dead" />
          </div>
          <div className="settings-buttons">
            <Button text="Reset password" style="dead" />
          </div>

          <div className="settings-buttons">
            <Button text="Log out" colorstyle="signup" onClick={handleLogOut} />
          </div>
        </div>

        <div className="centering">
          <NavigationBar
            discover={"idle"}
            chat={"idle"}
            settings={"active"}
            profile={"idle"}
          />
        </div>
      </body>
    </div>
  );
}
